"5c1ae82c29543ac887703776bf3da2c7dcce683d":"Fall","2fc096bb7b6596ab243d0286c9f43fdf2b9b406d":"No Change","93d13bad1d2c2841db127cb70cc35bfc98059fc9":"Asian Up",c098658ce3d3a258e4d155949a60072966b36db7:"Asian Down",ee2dbd5d6d82d0833069b07e7dd2848d3bf4d83a:"Matches","8444b7ce28bbc3443cc5cf73359b8353989b2a4b":"Differs","9e767ad03e5547f251044e0724dc1d9f3e75aeed":"Even",dc28f5f3c65ec611f0f30022650d24382d27448e:"Odd","18a63f5512afb5573e5b44deba78d629f0635317":"Over","2a268b89b83f8cb38ea48e46e93dd8840db512f9":"Under","4819b2f64fbd355ddbf0771d2b54b49c0d1796f5":"Please add a token first",aac1569ccf6b1a11b0ad0fbefdb9ffc777b4c733:"Click to select",da9f5de675878c0d60438194c913be6be8442451:"Welcome to the introduction to the binary bot, we will go through the basic steps to create a working bot. If you want to skip this tutorial click on the <b>Stop!</b> button at the top right of the page.","625a8ce764f231dee4f6daf9a85c097bf23a7374":"You will need to add the blocks to this area which is called the <b>workspace</b>.",f4bad39e0da47ce1f413083ec703c9bdb4e821bc:"To start pick a <b>symbol</b> block from markets. Some steps like this one don't have the <b>Next step</b> button, therefore you need to follow the instructions to go to the next step, (in this case picking a symbol from left should lead you to the next step.)","38ac2430b6fc7b6d5ecca94de399d86967392bbf":"Great! Now add it to the <b>trade</b> block.",a10a6510dcf74e17e02b8bae652f068465c35adc:"Alright! Now pick a <b>condition</b> block.",a8ce204c869e6df24277611290801e35b787c870:"OK! Now add it to the symbol you added in the previous step.","6ac4888b9a31f55ca7c32e00a269d7d1dc4708c8":"Very good! It's time to add the options needed by the condition block, pick a number",e20d6b63e449cc63246eb171e6d4368c060a60f5:"from the Math menu","80f10315585e12fc0dd2f7b7faa8a09a8034b79c":"Click on the number block to edit its value","0e9a192672d1a17830a967fe231606fa494dbba3":"change the value to 5 and add it to the <b>ticks</b> field of the condition block","9d58628fb102ecea586daa4fb81aa1539dbdc4eb":"OK, Now add all remaining options to the condition block","282ea251bdfda29ddf988b813e77ebb65c7d6c0d":"That's it, now you have a complete trade block with its options. It's time to define a strategy","061c155afc9f43271499f20bcce319696f4aa313":"This is a <b>Strategy</b> block. All the blocks you put in here are run for each and every tick received.","696c77bbfeb462218ecc62ad7c3cb026357d14d2":"The received tick value is in the block <b>tick</b> and the tick direction (up or down) is in the block <b>direction</b>. You can pick them from the <b>Strategy</b> menu",a4fda48ca1d26066926c0c7c007036585e797626:"For this tutorial we are not going to use those blocks, so we create our strategy by adding a <b>purchase</b> block. Please pick a purchase block","40cb4329c38e75111dfcf1c3a7d53f9ec44f63d2":"Now add it to the Strategy block.",d28ef98e1110ce8a06df4b2d42eae6c07990ae7b:"Nicely Done! The purchase block initiates a purchase defined by its dropdown list, e.g. if your condition block is of <b>Up/Down</b> type you will have <b>Up</b> and <b>Down</b> options on the purchase block to select from.","039b5485ec321d83859b48fc91bf895e52429312":"A Strategy block consisting of only a purchase block means to purchase as soon as the first tick was received.",a43189bbd3610654b30c9e287b7a8285c72f06ed:"After a purchase was started, the bot waits till the purchase is completed, and then gives the control to the <b>On Finish</b> block","2eb458fc248cf538e898779cd4814e28af5db24b":"Same as the Strategy block, the <b>On Finish</b> block can have multiple blocks defining its functionality. The On Finish block defines what to do when the previously purchased contract is finished.","0ecb627b112c26389825381d5280f557345ab194":"A <b>Trade Again</b> block creates a new trade and exits from the On Finish block. Now pick a Trade Again block.","6d08f40f24b29cd87eaf796ece4852012ac1a76c":"Now add it to the On Finish block","9f243ff5d65e374ceadc4d4521c541c828fee8b4":"Excellent! The <b>Trade Again</b> block starts a new trade immediately after the previous contract is finished, therefore creates an infinite loop which goes on and on until the Trade Again block isn't called e.g. in a logic block which its condition is unmet.","5670fb9533116ca78adec7a1bb8bc2f77212bf73":"OK, that's it. Now we have a working bot which buys a contract after the first tick and then creates another trade which is exactly the same as before.",d4ab4221f6388023bec13302714e98a84bbfb4c9:"If you changed a block by accident you can always undo/redo your changes using these buttons or Ctrl+Z for undo and Ctrl+Shift+Z for redo","26523ef1986f754f27ba90d1cbfe0211073d2ce2":"You can save/load your blocks using these tools",fda3db9f6403aa2eb92dd93ce7ff60503aa4f7c0:"At last! It's time to run the blocks we created. You can run/stop the blocks by clicking on the run/stop buttons in this menu. Please make sure you have chosen a Virtual Account before running the blocks.","837730f3669584a070e3252eccf39aa0b96d3820":"You can choose the token you want by the <b>Account</b> dropdown on the trade block. If you do not have any token in the dropdown please login using the <b>Login</b> button above. Please make sure to use Virtual Account tokens for testing.","291a075899eea8a2c208834bebacd0eb4add67c3":"You can add a token to the bot using the <b>Add Token</b> button.","803adad740b5756a975629ac142e7f520af7303e":"You can see the summary of your trades in this menu.",d3ed0ad6f5c5ccff91ba3f20d37a02c7474b84cb:"Go ahead and run the blocks. You can stop the code anytime you want using the stop button, or reset the values in the result panels using the reset button.","362ade1b08d481c8c83c5dbc63866c81b4706814":"Welcome to the binary bot, a blockly based automation tool for binary.com trades. If you want to skip this tutorial click on the <b>Stop!</b> button at the top right of the page.",ec58d9b45b6d9d2873a67648e21affc43d4108bc:"The blocks you put in here will create a binary bot code which you can then execute using the run button.",de35db98b87ad43d4e07602143a43514a2a0cbbc:"You can add blocks from here to the workspace","52cddf64d691a15a49eb06161837b195d3bd37a1":"Erase the blocks by dropping them in here.","11d8d3c8d82211465bc82e34a4fccd4ed958e94c":"Use this menu to load and save blocks","9a318407382efa52d00e6365ce62264a48bb644d":"Click to add a token after logging in, at least one token is needed. Get your token from","0154c0dabe7145db37e0b81bf667e7224abec0ba":"here","18c372be48fb3fb91352cc721df2d256fea4e4e8":"Use these buttons to Undo/Redo changes to your blocks.",c129fb8ed4d97d8c411c119cf19d66ff03c205b6:"See the summary of your trades in this menu.","400870cd7372b80f5d521c951a0759953f9fb181":"Use the run/stop buttons in this menu to run or stop your blocks, or reset your result panels.",e8077186267c1038681326ccb5ee9e7f97f8d8e5:"Good Luck!","7b6cafed3b869f5db714872c79abfc2b3be0ec5e":"Purchase was finished, result is:",a55c0563696291e6721a7f5c882639263190e6e1:"Could not get balance",f977a1b8eb64b809abfcaf7ca75f1a2377bed426:"tick received at:",ffbf39b40a3d65a8de69ded9c5541f9c87c1dd48:"Request received for history","6d3bfce4db92ba1e8e8f1cf88de6bb8f57aa8bfe":"Contracts are ready to be purchased by the strategy","8b70c504aa09cadfdc4baac6909b492d9d63db71":"Purchased",c74f890044cfe8fc5a3631d46797dc7613c1cf28:"Logged in to:","86a0945ed940718ca61a68acbc932da9acab762d":"No token is available to authenticate","312677f238bced75f4a7998263a4cd831c007be9":"The trade block can only accept submarket blocks","7386b7aecaf7dee307dffabf3024e6fea8b3e964":"The trade block cannot be inside binary blocks","377aa3b947c22a1acd37be94576856994ed46bdb":"Submarket blocks can only accept condition blocks",a8dc1b431f260fc1aed77d54595779c1b49c4f5b:"Submarket blocks have to be added to the trade block","2bedea95d05b4cb97ab758f9a2e1b69210b26e17":"Condition blocks have to be added to submarket blocks",b3214afd299cfa3952efc8d8853c7b5a7f340405:"does not support category:"